import ResponseHandler from '@/common/ResponseHandler';
import { request, response } from 'express';
import Spending from './spending.model';

export const store = (req = request, res = response, next) => {
  Spending.create(req.body)
    .then(ResponseHandler.json(res, 201))
    .catch(ResponseHandler.error(res, 500));
};

export const index = (req = request, res = response, next) => {
  Spending.find(req.query)
    .then(ResponseHandler.json(res, 200))
    .catch(ResponseHandler.error(res, 500));
};

export const show = async (req = request, res = response, next) => {
  try {
    const spending = await Spending.findOne({
      _id: req.params.id,
    });

    return res.status(200).json(spending);
  } catch (error) {
    return res.status(400).json({
      error: error.message,
    });
  }
};

export const update = (req = request, res = response, next) => {};

export const destroy = (req = request, res = response, next) => {};

